edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/xeno_effect_static_asset_location.proto";
import "youtube/api/innertube/xeno_effect_static_asset_signature_data.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message XenoEffectStaticAssetEntry {
	string asset_id = 1;
	XenoEffectStaticAssetLocation asset_location = 2;
	XenoEffectStaticAssetSignatureData signature_data = 3;
}
